Here's a TypeScript interface for the provided response object:
```typescript
interface ResponseObject {
  status: string;
  code: number;
  data: Array<{
    _id: string;
    _projectId: string;
    _organizationId: string;
    _userId: string;
    _fileId: string;
    _geoDataFileId: string;
    status: string;
    caption: string;
    capturedAt: string;
    createdAt: string;
    updatedAt: string;
    file: Array<{
      _id: string;
      _organizationId: string;
      _userId: string;
      src: string;
      status: string;
      visibility: string;
      createdAt: string;
      updatedAt: string;
      ext: string;
      url: string;
    }>;
    geoData: Array<{
      _id: string;
      _organizationId: string;
      status: string;
      src: string;
      visibility: string;
      createdAt: string;
      updatedAt: string;
      _userId: string;
      alt: string;
      ext: string;
      url: string;
    }>;
  }>;
}
```
This interface defines a `ResponseObject` type that has three properties: `status`, `code`, and `data`. The `data` property is an array of objects, each of which represents a single data record. Each data record object has multiple properties, including `_id`, `_projectId`, `_organizationId`, `_userId`, `_fileId`, `_geoDataFileId`, `status`, `caption`, `capturedAt`, `createdAt`, `updatedAt`, `file`, and `geoData`. The `file` and `geoData` properties are each an array of objects that represent a file and its associated metadata.
